enduser organization;

this team is almost a start up within a large, established end user organisation that is the biggest employer within the education sector in southern hemisphere.

they are building, from scratch, an artificial intelligence, deep learning chatbot similar to chatgpt and bing but only better!

you will be joining a friendly team of data scientists and experts to achieve this pinnacle through various milestones within the coming months and possibly years.

